import { Component } from '@angular/core';

@Component({
  selector: 'app-order-service',
  templateUrl: './order-service.component.html',
  styleUrls: ['./order-service.component.css']
})
export class OrderServiceComponent {

}

<div id="kt_app_toolbar" class="app-toolbar  py-3 py-lg-6 ">
  <div id="kt_app_toolbar_container" class="app-container  container-fluid d-flex flex-stack ">
    <div class="page-title d-flex flex-column justify-content-center flex-wrap me-3 ">
      <h1 class="page-heading d-flex text-gray-900 fw-bold text-uppercase fs-3 flex-column justify-content-center my-0">
        Ordenes de servicio
      </h1>


      <ul class="breadcrumb breadcrumb-separatorless fw-semibold fs-7 my-0 pt-1">
        <li class="breadcrumb-item text-muted">Agrega las ordenes de servicio de los clientes.</li>
      </ul>
    </div>
  </div>
</div>
